import random

from PyQt5.QtWidgets import QWidget, QHBoxLayout, QTableWidget, QPushButton, QVBoxLayout, QTableWidgetItem, QCheckBox, \
    QAbstractItemView, QLabel, QSpacerItem, QSizePolicy
from PyQt5.QtCore import Qt, QByteArray
from PyQt5.QtGui import QFont, QIcon, QPixmap
from faker import Factory


def icon_from_base64(base64):
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64))
    icon = QIcon(pixmap)
    return icon


class UI(QWidget):
    def __init__(self):
        super().__init__()
        # setup UI
        # This is `grade.ico`'s base64 encode string.
        img_b64 = b''
        icon = icon_from_base64(img_b64)
        self.setWindowIcon(icon)
        self.setWindowTitle(u"")
        self.resize(800, 480)
        self.table = QTableWidget(self)
        self.btn_add = QPushButton(u"")
        self.btn_del = QPushButton(u"")
        self.btn_modify = QPushButton(u"")
        self.btn_select_line = QPushButton(u"")
        self.btn_select_single = QPushButton(u"")
        self.btn_sort = QPushButton(u"")
        self.btn_rowcolor = QPushButton(u"")
        self.spacerItem = QSpacerItem(20, 20, QSizePolicy.Minimum, QSizePolicy.Expanding)
        self.vbox = QVBoxLayout()
        self.vbox.addWidget(self.btn_add)
        self.vbox.addWidget(self.btn_del)
        self.vbox.addWidget(self.btn_modify)
        self.vbox.addWidget(self.btn_select_line)
        self.vbox.addWidget(self.btn_select_single)
        self.vbox.addWidget(self.btn_sort)
        self.vbox.addWidget(self.btn_rowcolor)
        self.vbox.addSpacerItem(self.spacerItem)
        self.txt = QLabel()
        self.txt.setMinimumHeight(50)
        self.vbox2 = QVBoxLayout()
        self.vbox2.addWidget(self.table)
        self.vbox2.addWidget(self.txt)
        self.hbox = QHBoxLayout()
        self.hbox.addLayout(self.vbox2)
        self.hbox.addLayout(self.vbox)
        self.setLayout(self.hbox)
        self.table.setColumnCount(5)
        self.headers = [u"", u"", u"", u"", u""]
        self.table.setHorizontalHeaderLabels(self.headers)
        self.show()

        self.stu_id = 1
        self.selected = set()
        self.editable = True
        self.des_sort = True
        self.row_color = True
        self.faker = Factory.create()
        self.btn_add.clicked.connect(self.add_line)
        self.btn_del.clicked.connect(self.del_line)
        self.btn_modify.clicked.connect(self.modify_line)
        self.btn_select_line.clicked.connect(self.select_line)
        self.btn_select_single.clicked.connect(self.deny_muti_line)
        self.btn_sort.clicked.connect(self.sort_item)
        self.table.cellChanged.connect(self.cell_changed)
        self.btn_rowcolor.clicked.connect(self.rowcolor)
        self.set_header()
        self.table.setSortingEnabled(True)

    def add_line(self):
        """
        Add a new line to the table area.
        """
        self.table.cellChanged.disconnect()
        row = self.table.rowCount()
        self.table.setRowCount(row + 1)
        stu_id = 'B17' + '%06d' % self.stu_id
        ck = QCheckBox()
        ck.stateChanged.connect(lambda: (lambda s, status: self.selected.add(s) if status else self.selected.discard(s))
                                        (stu_id, ck.isChecked()))
        h = QHBoxLayout()
        h.setAlignment(Qt.AlignCenter)
        h.addWidget(ck)
        w = QWidget()
        w.setLayout(h)
        name = self.faker.name()
        description = self.faker.address()
        self.table.setCellWidget(row, 0, w)
        self.table.setItem(row, 1, QTableWidgetItem(stu_id))
        self.table.setItem(row, 2, QTableWidgetItem(name))
        item = QTableWidgetItem()
        item.setData(Qt.EditRole, random.randint(50, 100))  # it will set integer instead of string
        self.table.setItem(row, 3, item)
        self.table.setItem(row, 4, QTableWidgetItem(description))
        for y in range(1, 5):
            item = self.table.item(row, y)
            item.setTextAlignment(Qt.AlignCenter)
        self.stu_id += 1
        self.set_text(u"")
        self.table.cellChanged.connect(self.cell_changed)

    def del_line(self):
        """
        Delete a line.
        """
        row = self.table.rowCount()
        for x in range(row, 0, -1):
            # keyword: stu_id
            if self.table.item(x - 1, 1).text() in self.selected:
                self.table.removeRow(x - 1)
        self.selected.clear()
        self.set_text(u"")

    def modify_line(self):
        """
        Decide whether the line can be edited or not.
        """
        if self.editable:
            self.table.setEditTriggers(QAbstractItemView.NoEditTriggers)
            self.btn_modify.setText(u"")
            self.editable = False
        else:
            self.table.setEditTriggers(QAbstractItemView.AllEditTriggers)
            self.btn_modify.setText(u"")
            self.editable = True
        self.set_text(u"")

    def select_line(self):
        """
        Select the whole line instead of a cell.
        """
        if self.table.selectionBehavior() == 0:
            self.table.setSelectionBehavior(1)
            self.btn_select_line.setStyleSheet('background-color:lightblue')
        else:
            self.table.setSelectionBehavior(0)
            self.btn_select_line.setStyleSheet('')
        self.set_text(u"")

    def deny_muti_line(self):
        """
        Determines whether multiple lines can be selected. The default is yes.
        """
        if self.table.selectionMode() in [2, 3]:
            self.table.setSelectionMode(QAbstractItemView.SingleSelection)
            self.btn_select_single.setStyleSheet('background-color:lightblue')
        else:
            self.table.setSelectionMode(QAbstractItemView.ExtendedSelection)
            self.btn_select_single.setStyleSheet('')
        self.set_text(u"")

    def sort_item(self):
        """
        Make column `score` sortable.
        """
        if self.des_sort:
            self.table.sortItems(3, Qt.DescendingOrder)
            self.des_sort = False
            self.btn_sort.setStyleSheet('background-color:lightblue')
        else:
            self.table.sortItems(3, Qt.AscendingOrder)
            self.des_sort = True
            self.btn_sort.setStyleSheet('background-color:lightblue')
        self.set_text(u" / ")

    def set_header(self):
        """
        Make the header of the table beautiful.
        """
        font = QFont(u'', 10)
        font.setBold(True)
        self.table.horizontalHeader().setFont(font)
        self.table.setColumnWidth(0, 80)
        self.table.setColumnWidth(4, 198)
        self.table.horizontalHeader().setStyleSheet('QHeaderView::section{background:lightgray}')

    def cell_changed(self, row, col):
        """
        This means that the values of the cells in the table have changed.
        :param row: The row number.
        :param col: The column number.
        """
        item = self.table.item(row, col)
        item.setTextAlignment(Qt.AlignCenter)
        txt = item.text()
        self.set_text(u"%s%s , :%s" % (row + 1, col + 1, txt))

    def rowcolor(self):
        """
        Make the background color of the table alternate.
        """
        self.table.setAlternatingRowColors(self.row_color)
        self.table.setStyleSheet('alternate-background-color:#e5e5e5')
        self.row_color = not self.row_color
        self.btn_rowcolor.setText(u"" if self.row_color else u"")

    def set_text(self, txt):
        """
        Set comment information.
        :param txt: The information to set.
        """
        font = QFont(u'', 10)
        self.txt.setFont(font)
        self.txt.setText(txt)
